import React from 'react'

function LiquorCategory({props}) {

  return (
    <div className='component liquors'>
        {
           props.map(obj => (
            <div id='liquor' key={obj.id}>
                <main>
                    <img src={obj.image} alt={obj.title} />
                    <p style={{textAlign: "center", lineHeight: "1em"}}> 
                        Rating : {obj.rating}/5 <br />
                        {obj.title} <br />
                        {obj.description} <br />
                        Ksh. {obj.price}
                    </p>
                </main>
            </div>
            )) 
        }
    </div>
  )
}

export default LiquorCategory
